6093d5c8-808a-4794-8361-f1acffae1e73	353ec4bb-dd00-4118-8e1c-b436bddf57ba	en	Precizon Presbyopic NVA	Precizon Presbyopic is a hydrophilic acrylic IOL with a CTF (Continuous Transitional Focus) optic designed to correct presbyopia. The Precizon Presbyopic is designed with a patented CTF optic. This is an optic that has multiple segments for far and near on its anterior surface. Between the segments, a smooth transition from far to near is achieved. This transition offers a constant defocus between the two sharp focal points, delivering excellent intermediate vision. This clinical science compendium provides a consolidated view of a total of 10 studies, including: bench studies, scientific papers and presentations from international ophthalmology journals and congresses, involving the Precizon Presbyopic IOL and its patented Continuous Transitional Focus (CTF) technology. All this scientific data is the result of research studies conducted to evaluate the performance of the Precizon Presbyopic IOL, and/or the outcomes in patients receiving surgical implantation of the IOL. The transition zones of the CTF optic offer a full range of vision from near to infinity with a smooth continuous transition. The CTF aspheric surface forms a broad beam of light, a zone with an enhanced depth of focus with uninterrupted high-quality images for the brain to translate into clear vision at all distances. In cases of tilt or misalignment, the patient can still benefit from near and far vision as the segmented zones allow a steady light distribution. The misalignment tolerance and the use of segments instead of concentric rings reduce photic phenomena thereby helping patients to adapt more naturally to their new vision. Aberration Negative (- 0.11 m), Continuous Transitional Focus (CTF) optic Hybrid hydrophobic & hydrophilic monomers. Ultraviolet filtering HEMA/EOEMA copolymer Continuous Transitional Focus (CTF) is a patented optic designed by Ophtec. This video explains the CTF optic. Prof. Dr. Mike Holzer from Germany presents outcomes and patient satisfaction of the Precizon Presbyopic Multifocal IOL. Dr Tiago Monteiro is one of the first ophthalmic surgeons who started implanting Ophtec's new Precizon Presbyopic IOL. In this video he answers questions about his first impressions of the lens, how this lens addresses pupil size problems and natural vision. Dr. Mercedes Otero shares her experiences with the Precizon Presbyopic IOL Dr. Luis Len-Ibez, David P. Piero Clnica Oftalmolgica MOAT (Castelln, Spain) Jorge L. Ali, Antonio Martnez-Abad, Ramn Ruiz-Mesa, Hyo Myung Kim, Javier Mendicute, Filomena J. Ribeiro, Mike P. Holzer & Mario Cant-Cerdn Javier Mendicute MD, PHD. Insert to cataract & refractive surgery Today Europe. Ramn Ruiz Mesa MD, Tiago Monteiro MD. Ophthalmology and Therapy.	\N	\N	\N
