a3ed5709-92bf-4fd8-91e5-46437579c2ff	c1d3f86d-ec4b-4758-ba57-94a47fde728a	en	Artisan Myopia 206	A predictable, reliable, stable and versatile iris fixated IOL designed to correct myopia. The Artisan myopia was the first FDA-approved phakic IOL. The lens has passed the test of time by filling the need for those who seek a predictable and stable solution for the surgical correction of myopia. The design of the Artisan 206 is based on the long-term experience of iris fixation. The Artisan concept has the longest design history of any phakic IOL still in use. The Artisan 206 is designed for doctors seeking an IOL with a predictable, reliable, stable and versatile surgical procedure. Artisan IOLs make your choices simpler. There is no need to make complicated decisions based on vaulting. Dr. C. Budo explains the implantation process of an Artisan PIOL. Dr. Roberto Fernndez-Buenaga is one of Ophtec's ArtiLens trainers. We asked him how he prepares participants for their first ArtiLens implantation and why he prefers ArtiLens IOLs. Prof J.L. Gell shows the results of a study in which, the corneal endothelial cell decay is compared in a group of patients where an iris claw style IOL in only one eye had been implanted. Dr. Srgio Kwitko has over 16 years experience with the Artisan lens. In this presentation he shares his thoughts and experiences. Merce Morral, MD, PhD, Jose L. Gell, MD, PhD, Mostafa A. El Husseiny, MD, Daniel Elies, MD, Oscar Gris, MD, PhD, Felicidad Manero, MD. J Cataract Refract Surg 2016; 42:117126. Silva RA, Jain A, Manche EE. Archives of Ophthalmology. 2008; 126(6):775-81. Saxena R, Boekhoorn SS, Mulder PG, Noordzij B, Rij GV, Luyten GP. Ophthalmology. 2008; 115(4):608-13. Meltendorf C; Cichocki M; Kohnen T. Ophthalmologica. 2008; 222 (2): 69-73. Chen L-J, Chang Y-J, Kuo JC, Rajagopal R, Azar DT. J Cataract Refract Surgery. 2008; 34:1181-1200. Neuhann IM, Neuhann TF, Heimann H, Schmickler S, Gerl RH, Foerster MH. J Cataract Refract Surgery. 2008; 34:164